import React from "react";
import { BrowserRouter as Router, Link, Route, Routes } from "react-router-dom";

function Header({ routes }) {
    return (
        <header>
            <div className="logo-container">
                <img
                    src="https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG"
                    alt="AC Milan Logo"
                    className="logo-img"
                />
                <span className="logo-text">AC Milan</span>
                <ul className="nav">
                    {routes.map(route => (
                        <li key={route.path}>
                            <Link to={route.path}>{route.label}</Link>
                        </li>
                    ))}
                </ul>
            </div>
            <div className="presentation"></div>
        </header>
    );
}

function About() {
    return <h2>Про клуб</h2>;
}

function Team() {
    return <h2>Основна команда</h2>;
}

function Youth() {
    return <h2>Молодіжна команда</h2>;
}

function App() {
    const routes = [
        { path: "/about", element: <About />, label: "Про клуб" },
        { path: "/team", element: <Team />, label: "Основна команда" },
        { path: "/youth", element: <Youth />, label: "Молодіжна команда" }
    ];

    return (
        <Router>
            <div>
                <Header routes={routes} />
                <Routes>
                    {routes.map(route => (
                        <Route key={route.path} path={route.path} element={route.element} />
                    ))}
                </Routes>
            </div>
        </Router>
    );
}

export default App;
